# https://leetcode.com/problems/n-queens/

from typing import List

class Solution:
	def solveNQueens(self, n: int) -> List[List[str]]:
		chessboards = list()
		chessboard = list()

		cols = set()
		positiveDiag = set()
		negativeDiag = set()

		def backtracking(row):
			if row == n:
				chessboards.append(list())
				for queenPos in chessboard:
					row_to_str = ["."] * n
					row_to_str[queenPos] = "Q"
					chessboards[-1].append("".join(row_to_str))
				return
			
			for c in range(n):
				if c in cols or (row+c) in positiveDiag or (row-c) in negativeDiag:
					continue
				cols.add(c)
				positiveDiag.add(row+c)
				negativeDiag.add(row-c)
				chessboard.append(c)
				backtracking(row+1)
				cols.remove(c)
				positiveDiag.remove(row+c)
				negativeDiag.remove(row-c)
				chessboard.pop()
		

		backtracking(0)
		return chessboards


